text:
UK का कोई एक शहर दाऊद ने आरक्षण या किसान आंदोलन के नाम पर ना जलाया
फिर भी उसकी संपत्ति जप्त हो गयी
@sardanarohit @sudhirchaudhary

देश की वर्तमान राजनीति का यह दुर्भाग्यपूर्ण पक्ष है कि
यहां कुछ लोग अपने स्वार्थ हेतु नींबू निचोड़ने का प्रयास कर रहे हैं
@SirPareshRawalpic.twitter.com/fJnw3haRzv

“We were all ready to die for the country but what we did not discover was we have to live for the country”
Jim Paredes

@SirPareshRawal

में तो कहता हु गाजा पट्टी से इसरायली विस्थापितों को बुला लेते हे
कश्मीर में रोहिंग्या मुस्लिम के साथ अमन चेन से रहेंगे
@sardanarohit

जो विपक्ष "सब का साथ सब का विकास" में व्यंग मारते फिरते हे
वो आज "हम 72 होंगे तो भी लाखो के जनाज़े निकाल देंगे" पर छुप गए हे
@SirPareshRawal

आप जानते हे "CON"gress के पहले तीन अक्षरों का अर्थ गूगल क्या दिखता हे?
ये तो "चोर"gress पार्टी हो गयी
